import * as React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';


export default function Heap() {
  return (
    <Card sx={{ maxWidth: 345 }} >
      <CardMedia
        component="img"
        height="200"
        image="./BST.jpg"
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Heap
        </Typography>
        <Typography variant="body2" color="text.secondary">
        Heap data structure is a complete binary tree that satisfies the heap property, 
        where any given node is. always greater than its child node/s and the key of the
         root node is the largest among all other nodes. This property is also called max heap property.
        </Typography>
      </CardContent>

    </Card>
  );
}
